// FIXED ELEMENT
function fixedElement() {
	'use strict';

	if ($('header').length) {
        var path = window.location.pathname;
		var scrollTop = $(window).scrollTop();
		var winWidth = $(window).width();
		if (winWidth > 1360) {
			if (scrollTop > 600) {
				$('header').addClass('scroll');
			} else if( path == '/') {
				$('header').removeClass('scroll');
			} else {
                $('header').addClass('scroll');
            }
		} else {
            $('header').addClass('scroll');
        }

	}

}

// MOBILE MENU
function menu() {
	'use strict';

	var pull = $('#pull');
	var menu = $('nav ul');
    var dropper = $('nav ul li ul');
	var menuHeight = menu.height();
	if (pull.length) {
		$(pull).on('click', function (e) {
			e.preventDefault();
			menu.slideToggle();
            dropper.removeAttr( 'style' );
		});
	}

}

