/* Onload */
$(window).load(function () {
	'use strict';

	// Lazy Load
	$('#gallery .type1 a img.portrait, #gallery .type0 a img.landscape').lazyload({
		data_attribute: 'lazy',
		effect: 'fadeIn',
		failure_limit: 100,
		threshold: 200,
		skip_invisible: false
	});

	// Slideshow Fix
	$('#slideshow').css('background-image', 'none');
	$('html, body').trigger('resize');
    
    //scroll to getting started
    var path = window.location.hash;
    if (path == '#gettingStarted'){
        $('html, body').animate({
            scrollTop: $("#gettingStarted").offset().top 
        }, 300);
    }

});